Over the past two years 100 young men and women competed on five record-breaking VH1 shows (&quot;Flavor of Love: Seasons 1 &amp; 2&quot;, &quot;I Love New York: Seasons 1 &amp; 2&quot; and &quot;Rock of Love&quot;) in a quest to find true love. But were they really looking for love? 

VH1 and 51 Minds Entertainment present the new television series &quot;I Love Money&quot;. It's a show that gives 15 wildly popular All-Star cast members from the &quot;of Love&quot; series, the chance to battle it out for what they really wanted all along -- fame -- and even more importantly -- money. Last time these cast members competed it was for the heart of Bret Michaels or Flavor Flav, but on &quot;I Love Money&quot; the stakes are arguably higher - and definitely &quot;greener&quot; -- the winner is walking away with $250,000! 

The cast (made up of favorites like Hottie, Mr. Boston, Pumkin, 12 Pack, Smiley) will pack their bags and head to an exotic, tropical location in Mexico where they will live during the ten episode series. Once moved in, the cast will meet their host Craig Jackson (X-show, 30 Seconds to Fame) and start the competition! Each hour-long episode will include an outrageous challenge (inspired by the most famous and iconic moments from the &quot;of Love&quot; shows), exciting rewards and suspense-filled eliminations. A Survivor-esque spin on the &quot;of Love&quot; format gives a single cast member each week the power of deciding who goes home. It will be a cutthroat competition as cast members sharpen their backstabbing skills in the fight for their fortune. 

